    String toString() { return "Account(number=$number)" }
}

mapperUtilsClass:
class MapperUtils {
    static void putFirstAddress(Map data, Map dataTarget) {
        if (data.address_list) {
            def addressList = data.address_list as List
            dataTarget.address = addressList.first()
        }
    }
    static void putFirstAccount(Map data, Map dataTarget) {
        if (data.account_list) {
            def accountList = data.account_list as List
            dataTarget.account = accountList.first()
        }
    }
}
